import { Routes, Route } from 'react-router-dom'
import {Container} from 'react-bootstrap'
import Home from './pages/Home'

function App() {
  return (
    <>
     <Navbar/>
     <Container className='mb-4'>
      <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='about' element={<About/>}/>
      </Routes>
     </Container>
    </>
  );
}

export default App;
